import React, { useState, useRef, useEffect } from 'react';
import './App.css';

const LANGGRAPH_URL = 'http://localhost:2024';
const UPLOAD_URL = 'http://localhost:8000';

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const messagesEndRef = useRef(null);
  const fileInputRef = useRef(null);

  useEffect(() => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages]);

  const sendMessage = async (e) => {
    e.preventDefault();
    if (!input.trim() || isLoading) return;

    const userMessage = { role: 'user', content: input };
    setMessages((prev) => [...prev, userMessage]);
    setInput('');
    setIsLoading(true);

    try {
      const response = await fetch(`${LANGGRAPH_URL}/runs/stream`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          assistant_id: 'agent',
          input: {
            messages: [{ role: 'user', content: input }]
          },
          stream_mode: ['messages']
        }),
      });

      if (!response.ok) {
        throw new Error('Failed to reach LangGraph server');
      }

      const reader = response.body.getReader();
      const decoder = new TextDecoder();
      let assistantContent = '';

      while (true) {
        const { done, value } = await reader.read();
        if (done) break;

        const chunk = decoder.decode(value);
        const lines = chunk.split('\n');

        for (const line of lines) {
          if (line.startsWith('data: ')) {
            try {
              const data = JSON.parse(line.slice(6));
              if (data.messages && data.messages.length > 0) {
                const lastMsg = data.messages[data.messages.length - 1];
                if (lastMsg.role === 'assistant' || lastMsg.type === 'ai') {
                  // Handle content that may be string or object with text field
                  const content = lastMsg.content;
                  if (typeof content === 'string') {
                    assistantContent = content;
                  } else if (Array.isArray(content)) {
                    // Content might be array of content blocks
                    assistantContent = content.map(c => c.text || c).join('');
                  } else if (content && content.text) {
                    assistantContent = content.text;
                  } else if (content) {
                    assistantContent = JSON.stringify(content);
                  }
                }
              }
            } catch (parseErr) {
              // Skip non-JSON lines
            }
          }
        }
      }

      if (assistantContent) {
        setMessages((prev) => [...prev, { role: 'assistant', content: assistantContent }]);
      } else {
        setMessages((prev) => [...prev, { role: 'assistant', content: 'No response received.' }]);
      }
    } catch (error) {
      setMessages((prev) => [...prev, { role: 'assistant', content: 'Error: Could not reach the server.' }]);
    } finally {
      setIsLoading(false);
    }
  };

  const handleFileUpload = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await fetch(`${UPLOAD_URL}/upload`, {
        method: 'POST',
        body: formData,
      });
      if (response.ok) {
        setMessages((prev) => [...prev, { role: 'system', content: `File "${file.name}" uploaded successfully.` }]);
      } else {
        setMessages((prev) => [...prev, { role: 'system', content: `Failed to upload "${file.name}".` }]);
      }
    } catch (error) {
      setMessages((prev) => [...prev, { role: 'system', content: 'Error: Could not upload file.' }]);
    }
    fileInputRef.current.value = '';
  };

  return (
    <div className="app">
      <header className="header">
        <h1>Semantic Search Agent</h1>
        <input type="file" ref={fileInputRef} onChange={handleFileUpload} style={{ display: 'none' }} />
        <button className="upload-btn" onClick={() => fileInputRef.current.click()}>Upload Book</button>
      </header>

      <div className="chat-container">
        <div className="messages">
          {messages.length === 0 && <div className="empty-state">Ask me anything about your books!</div>}
          {messages.map((msg, idx) => (
            <div key={idx} className={`message ${msg.role}`}>
              <div className="message-content">{msg.content}</div>
            </div>
          ))}
          {isLoading && <div className="message assistant"><div className="message-content">Thinking...</div></div>}
          <div ref={messagesEndRef} />
        </div>

        <form className="input-form" onSubmit={sendMessage}>
          <input
            type="text"
            value={input}
            onChange={(e) => setInput(e.target.value)}
            placeholder="Type your message..."
            disabled={isLoading}
          />
          <button type="submit" disabled={isLoading || !input.trim()}>Send</button>
        </form>
      </div>
    </div>
  );
}

export default App;
